import React from 'react'
import Grid from '@material-ui/core/Grid';
import { Typography } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';


const useStyles = makeStyles((theme) => ({
    root: {
      flexGrow: 1,
    },

}))


const Aboutus = () => {
    classes=useStyles()
   
    return (
        <>
         <div className={classes.root} >
        <Grid container  >

           

            <Grid item md={6} >

                <Paper className={classes.Paper} elevation={1}>
                    <Typography variant="headline" component="h3">
                        ABOUT US 
                     </Typography>

                     <Typography>Sunset Ludge</Typography>
                     <Typography component="body1" >Lorem, ipsum dolor sit amet consectetur
                      adipisicing elit. Animi natus quasi quam alias quos libero cumque!
                       Quia modi quibusdam voluptates neque optio molestiae commodi, distinctio iure!
                        Quod hic delectus accusamus.</Typography>
                </Paper>

                <Button color="primary">Primary</Button>


                </Grid>

                <Grid item >

                    <img src="image/about.jpg" alt="" />

                    </Grid>


            </Grid>

            </div>




        </>
    )
}

export default Aboutus
